import React from "react";
import { Header } from "./componentes/Header";
import { ProductoLista } from "./componentes/Productos/index"; //se coloca index porque la carpeta no se llama igual al componente
import 'boxicons';

function App() {
  return (
    <div className="App">
     <Header />
     <ProductoLista />
    </div>
  );
}

export default App;
